Dear Otto,

This is the basic structure for a HTML page:

&lt;html&gt;
&lt;head&gt;
&lt;/head&gt;
&lt;body&gt;
&lt;/body&gt;
&lt;/html&gt;

So our default.view using mod_harbour is going to be:

default.view
Code: Select all  Expand view
{{View("head")}}
{{View("body")}}


As mod_harbour is able to build "nested" views, now we need to define head.view and body.view

head.view
Code: Select all  Expand view
&lt;html&gt;
&lt;head&gt;
&lt;/head&gt;


body.view
Code: Select all  Expand view
&lt;body&gt;
&lt;/body&gt;
&lt;/html&gt;


From mod_harbour we do:
View( "default" )

And mod_harbour will put all the parts together. Now lets say we want to have a menu and a browse:
body.view
Code: Select all  Expand view
&lt;body&gt;
{{View("menu")}}
{{View("browse")}}
&lt;/body&gt;
&lt;/html&gt;


Now we create a menu.view and a browse.view

This way all the complexity of a HTML page (lots of tags, very easy to make a mistake) is structured in small and easy to manage views

This is the beauty and the power of using mod_harbour Views engine
